def genotype_fitness_Y1W1Y2W2(input_array, dominance):
    
    YM_fem = input_array[0]
    YM_male = input_array[1]
    IIIM_fem = input_array[2]
    IIIM_male = input_array[3]
    W1_fem = input_array[4]
    W1_male = input_array[5]
    W2_fem = input_array[6]
    
    YM_fem_dom = 0
    YM_male_dom = 0
    IIIM_fem_dom = 0
    IIIM_male_dom = 0
    W1_fem_dom = 0
    W1_male_dom = 0
    
    #========== SECTION GENOTYPE_FITNESS A START ==========#
    # Chooses dom or "h" values based on the dominance type
    if dominance == 'additive':
        YM_fem_dom = 0.5
        YM_male_dom = 0.5
        IIIM_fem_dom = 0.5
        IIIM_male_dom = 0.5
        W1_fem_dom = 0.5
        W1_male_dom = 0.5
        
    if dominance == 'dominant':
        if(YM_fem <= 0):
            YM_fem_dom = 1
        if(YM_male <= 0):
            YM_male_dom = 1
        if(IIIM_fem <= 0):
            IIIM_fem_dom = 1
        if(IIIM_male <= 0):
            IIIM_male_dom = 1
        if(W1_fem >= 0):
            W1_fem_dom = 1
        if(W_fem >= 0):
            W1_male_dom = 1
        
    if dominance == 'recessive':
        if(YM_fem >= 0):
            YM_fem_dom = 1
        if(YM_male >= 0):
            YM_male_dom = 1
        if(IIIM_fem >= 0):
            IIIM_fem_dom = 1
        if(IIIM_male >= 0):
            IIIM_male_dom = 1
        if(W1_fem >= 0):
            W1_fem_dom = 1
        if(W_fem >= 0):
            W1_male_dom = 1  
        
